import * as React from 'react';
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';
import { IPokerActivityContainerProps } from '../../shared';

class PokerActivityContainer extends React.Component<
	IPokerActivityContainerProps
> {

	render(): JSX.Element {
		return(
			<div>
				<div>Please enter your details</div>
				<div>
					<form>
					<label>
						<div>
							Name: <input type="text" onChange={this.handleClientName} />
						</div>
						<div>
							User ID: <input type="text" onChange={this.handleClientId}/>
						</div>
					</label>
					<input type="submit" value="Submit" />
					</form>
				</div>
			</div>
		);
	}
}

export { PokerActivityContainer };
